import * as React from "react";
import "./style-ping.css";
import * as Mui from "@material-ui/core";

export default function PingDummy({ urlData }) {
	return (
		<>
			<Mui.TableContainer component={Mui.Paper}>
				<Mui.Table style={{ minWidth: "700" }} aria-label="customized table">
					<Mui.TableHead>
						<Mui.TableRow>
							<Mui.TableCell>Top Ping Sites</Mui.TableCell>
							<Mui.TableCell align="right">Count</Mui.TableCell>
						</Mui.TableRow>
					</Mui.TableHead>

					<Mui.TableBody>
						{urlData.map((elem) => (
							<Mui.TableRow key={elem.url}></Mui.TableRow>
						))}
					</Mui.TableBody>
				</Mui.Table>
			</Mui.TableContainer>

			<Mui.Box className="resultsBox">
				<Mui.Box>
					{urlData.map((elem) => (
						<Mui.List key={elem.url}>
							{" "}
							<span> {elem.count}</span>
						</Mui.List>
					))}

					{urlData.map((elem) => (
						<Mui.List key={elem.count}>
							{" "}
							<span> {elem.count}</span>
						</Mui.List>
					))}
				</Mui.Box>
			</Mui.Box>
		</>
	);
}
